window.bookSummaryJSON = "<p><b>*AN INSTANT </b><b><i>NEW YORK TIMES</i></b><b> BESTSELLER*</b></p> <p><b>\"This novel will be remembered as one of the best thrillers of the year.\" --</b><b><i>Associated Press</i></b></p> <p><b>\"A shocking stunner in every way. The perfect thriller.\" --Robert Crais</b></p> <p><b><i>When darkness closes in - he's your last, best hope. Evan Smoak returns in Gregg Hurwitzâ€™s #1 international bestselling Orphan X series in </i></b><b>Out of the Dark</b><b><i>.</i></b></p> <p>Taken from a group home at age twelve, Evan Smoak was raised and trained as part of the Orphan Program, an off-the-books operation designed to create deniable intelligence assets - i.e. assassins. Evan was Orphan X. He broke with the Program, using everything he learned to disappear and reinvent himself as the Nowhere Man, a man who helps the truly desperate when no one else can. But now Evan's past is catching up to him.</p> <p>Someone at the very highest level of government has been trying to eliminate every trace of the Orphan Program by killing all the remaining Orphans and their trainers. After Evan's mentor and the only father he ever knew was killed, he decided to strike back. His target is the man who started the Program and who is now the most heavily guarded person in the world: the President of the United States.</p> <p>But President Bennett knows that Orphan X is after him and, using weapons of his own, he's decided to counter-attack. Bennett activates the one man who has the skills and experience to track down and take out Orphan X - the first recruit of the Program, Orphan A.</p> <p>With Evan devoting all his skills, resources, and intelligence to find a way through the layers of security that surround the President, suddenly he also has to protect himself against the deadliest of opponents. It's Orphan vs. Orphan with the future of the country - even the world - on the line.</p>"; 
